import React from 'react';
import './Card.css';
export default function Card(props){
      return(
          <>
          <div id='card' className="card" onMouseEnter={()=>{
             document.getElementById("card").style.cursor="pointer";
          }}>
              <div className="img">
                 <img src={props.image} alt="" />
              </div>
              <h4 style={{color:"crimson",marginBottom:"5px"}}>{props.title}</h4>
              <div className="text" >
               {props.text}
              </div>
          </div>
          </>
      )
}
